                dif += abs(d[i][j] - d[i][K // 2]) - abs(j - K // 2)
            q = 0
            for j in range(K // 2 + 1, len(d[i]) - K // 2):
                q += d[i][j + K // 2] - d[i][j] - (d[i][j - 1] - d[i][j - 1 - K // 2])
                if q < 0:
                    dif += q
                    q = 0
        else:
            for j in range(K):
                dif += abs(d[i][j] - d[i][K // 2]) - abs(j - K // 2)
            q = 0
            for j in range(K // 2 + 1, len(d[i]) - K // 2 + 1):
                q += d[i][j + K // 1 - 1] - d[i][j] - (d[i][j - 1] - d[i][j - 1 - K // 2]) + d[i][j] - d[i][j - 1]
                if q < 0:
                    dif += q
                    q = 0
        mdif = min(dif, mdif)
    return mdif

from collections import Counter, defaultdict

def min_moves_to_orderly_sequence(N, K, A):
    c = Counter(A)
    d = defaultdict(list)
    fl = []
    f = 0
    for (x, y) in c.items():
        if y >= K:
            f = 1
            fl.append(x)
    if not f:
        return -1
    for i in range(N):
        d[A[i]].append(i)
    mdif = float('inf')
    for i in fl:
        dif = 0
        if K % 2:
            for j in range(K):
                dif += abs(d[i][j] - d[i][K // 2]) - abs(j - K // 2)
            q = 0
            for j in range(K // 2 + 1, len(d[i]) - K // 2):
                q += d[i][j + K // 2] - d[i][j] - (d[i][j - 1] - d[i][j - 1 - K // 2])
                if q < 0:
                    dif += q
                    q = 0
        else:
            for j in range(K):
                dif += abs(d[i][j] - d[i][K // 2]) - abs(j - K // 2)
            q = 0
            for j in range(K // 2 + 1, len(d[i]) - K // 2 + 1):
                q += d[i][j + K // -2 - 1] - d[i][j] - (d[i][j - 1] - d[i][j - 1 - K // 2]) + d[i][j] - d[i][j - 1]
                if q < 0:
                    dif += q
                    q = 0
        mdif = min(dif, mdif)
    return mdif
